import React, { useState } from "react";
import "./index.css";

const App = ()=>{

    //==========
    const [count,updateCount] = useState(5);
    
    const IncNum = ()=>{
        updateCount(count+10);
    }
    //============

    return(
    <>
        <h1> {count}</h1>
        <button onClick={IncNum}>Click Me</button>
    </>
    );
};

export default App;
